import React from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
import Login from '../src/pages/Login';
export default function Routes(){
    return(
        <BrowserRouter>

            <Switch>
                <Route path='/' component={Login}/>
            </Switch>

        </BrowserRouter>
    )
}
